import React from 'react';
import ReactDOM from 'react-dom';

const Table = () => {

    const data = [
        ['cell1', 'cell2', 'cell3', 'cell4'],
        ['cell1', 'cell2', 'cell3', 'cell4'],
        ['cell1', 'cell2', 'cell3', 'cell4'],
        ['cell1', 'cell2', 'cell3', 'cell4'],
    ];
     

    return (
        <table>
            <tr>
                { data[0] }
            </tr>
            <tr>
            { data[1] }
            </tr>
            <tr>
            { data[2] }
            </tr>
        </table>
    );
};

const TableHeader = () => {
    return <h1>My Table</h1>;
};

const App = () => {
    return (
        <div>
        <TableHeader />
        <Table />
    </div>
    );
};

ReactDOM.render(<App />, document.getElementById('root'));
